import Document, { Head, Main, NextScript } from "next/document";

class CustomDocument extends Document {
  render() {
    return (
      <html>
        <Head>
          <div className='title'>Daeun's Portfolio</div>
          {/* <link
            rel='stylesheet'
            href='css/styles.css'
            crossOrigin='anonymous'
          /> */}
        </Head>
        <body>
          <Main />
          <NextScript />
        </body>
      </html>
    );
  }
}

export default CustomDocument;
